content.css:
p {
  font-size: 20px;
  font-weight: bold;
}
p em {
  background: yellow;
  padding: 5px;
}
.custom-hierarchy-table {
  border-collapse: collapse;
  width: 100%;
  table-layout: auto;
}
.custom-hierarchy-table th,
.custom-hierarchy-table td {
  border: 1px solid #e0e0e0;
  padding: 8px 12px;
  text-align: left;
  background: #fff;
  font-size: 14px;
}
.custom-hierarchy-table th {
  background: #f5f5f5;
  font-weight: 600;
  border-bottom: 2px solid #d0d0d0;
  user-select: none;
}
.custom-hierarchy-table tr:hover td {
  background: #f0f6ff;
}
